import "./Build.css"
import Button from './Button/Button.js'

function Build() {
    return (
        <div >
            <Button text="Back" />
            <Button text="Share" />
            <Button text="Reset" />
            <Button text="Lock" />
        </div>
    )
}

export default Build;
